    [],nt"revision_timestamp": "2015-06-17T01:58:25.413922",nt"name": "acute-and-chronic-studies-with-waterfowl-exposed-to-petroleum-hydrocarbons",nt"isopen":
    false,nt"url": null,nt"notes": "Mallard ducks fed 0.25, 1.0, 2.5, 3.0,
    or 5.0 percent South Louisiana crude oil exhibited decreases in egg production,
    fertility, and hatchability in proportion to the concentration of oil. Extremely
    low amounts of petroleum hydrocarbons were also toxic to fertile, incubating mallard
    eggs. Our data suggests that adult waterfowl may be able to adapt and tolerate high
    concentrations of ingested petroleum hydrocarbons, but that all phases of reproduction
    and early development are severely impaired by low concentrations of petroleum hydrocarbons.",nt"license_title":
